import React, { useEffect, useState } from "react";
import axios from 'axios';
import { ToastContainer, toast } from 'react-toastify';
import 'react-toastify/dist/ReactToastify.css';
import { DatePicker, TimePicker, Button, Card, Typography, Row, Col, Form } from 'antd';
import Comment from './comment.js';

const Choise = () => {
  const [reviews, setReviews] = useState([]);
  const [overallRating, setOverallRating] = useState(0);
  const [courtConditionRating, setCourtConditionRating] = useState(0);
  const [ringsConditionRating, setRingsConditionRating] = useState(0);
  const [comment, setComment] = useState('');
  const [date, setDate] = useState(null);
  const [time, setTime] = useState(null);

  useEffect(() => {
    const fetchReviews = async () => {
      try {
        const response = await axios.get('');
        if (Array.isArray(response.data)) {
          setReviews(response.data);
        } else {
          console.error('Fetched data is not an array:', response.data);
          setReviews([]);
        }
      } catch (error) {
        console.error('Error fetching reviews:', error);
        setReviews([]);
      }
    };
    fetchReviews();
  }, []);

  const submitReview = async (values) => {
    const { comment, date, time } = values;
    if (!comment || overallRating === 0 || courtConditionRating === 0 || ringsConditionRating === 0 || !date || !time) {
      toast.error("Пожалуйста, заполните все поля!");
      return;
    }

    const newReview = {
      name: "Имя пользователя",
      overallRating,
      courtConditionRating,
      ringsConditionRating,
      comment,
      date,
      time,
    };

    try {
      await axios.post('', newReview);
      setReviews([...reviews, newReview]);
      setComment('');
      setOverallRating(0);
      setCourtConditionRating(0);
      setRingsConditionRating(0);
      setDate(null);
      setTime(null);
      toast.success("Отзыв успешно отправлен!");
    } catch (error) {
      console.error('Error submitting review:', error);
      toast.error("Ошибка при отправке отзыва.");
    }
  };

  return (
    <div className="container">
      <Row gutter={16}>
        <Col span={12}>
          <img src="https://открыватор.москва/file/2015/10/karta-moskvi.jpg" alt="map" style={{ height: '180px', width: '250px' }} />
        </Col>
        <Col span={12}>
          <Card title="Набережная">
            <Typography.Text>
              <img src={images.point} height="23px" width="23px" alt="" /> Адрес:
            </Typography.Text>
            <Button type="primary" style={{ marginTop: '16px' }}>Я приду</Button>
          </Card>
        </Col>
      </Row>
      <br />
      <Form onFinish={submitReview}>
        <Form.Item name="date" rules={[{ required: true, message: 'Выберите дату!' }]}>
          <DatePicker style={{ width: '100%' }} placeholder="Дата" />
        </Form.Item>
        <Form.Item name="time" rules={[{ required: true, message: 'Выберите время!' }]}>
          <TimePicker style={{ width: '100%' }} placeholder="Время" />
        </Form.Item>
        <Comment
          reviews={reviews}
          overallRating={overallRating}
          setOverallRating={setOverallRating}
          courtConditionRating={courtConditionRating}
          setCourtConditionRating={setCourtConditionRating}
          ringsConditionRating={ringsConditionRating}
          setRingsConditionRating={setRingsConditionRating}
          comment={comment}
          setComment={setComment}
        />
        <Form.Item>
          <Button type="primary" htmlType="submit">Отправить отзыв</Button>
        </Form.Item>
      </Form>
      <ToastContainer />
    </div>
  );
}

export default Choise;
